import React from 'react';
import '../style/AboutGlutenPage.css';
import Header from "./Header";
// import Footer from "./Footer";

function AboutGlutenPage() {
    return (
<>
<Header />
<section id="banner" />
<figure>
  <img src="./images/aboutgluten-comic/banner.svg" alt="banner" />
</figure>

{/* 主要內容區 */}
<section id="comic" />
<h1 c>關於麩質<br/>vs<br/>無麩質</h1>
<div className="whats-gluten">
<figure className="part1">
  <img src="./images/aboutgluten-comic/califlour-bg.svg" alt="califlour bg" />
</figure>
<figure className="part2">
  <img src="./images/aboutgluten-comic/character-bg.svg" alt="character bg" />
</figure>
<figure className="talk1">
  <img src="./images/aboutgluten-comic/califlour-talk.svg" alt="califlour talk" />
</figure>
<figure className="talk2">
  <img src="images/aboutgluten-comic/character-talk.svg" alt="character talk" />
</figure>
<figure className="part3">
  <img src="images/aboutgluten-comic/character-bg2.svg" alt="character bg2" />
</figure>
<figure className="talk3">
  <img src="images/aboutgluten-comic/character-reply2.svg" alt="character reply2" />
</figure>
<figure className="part4">
  <img src="./images/aboutgluten-comic/rice-talk.svg" alt="" />
</figure>
</div>
{/* <Footer /> */}
</>
);
}
export default AboutGlutenPage;
